public int[] comparearray() 
{     
    cell=0;    
    for(i=0;i<15;i++)
    {
        for(j=0;j<15;j++)
        {
            if(!a[i][j].isEmpty())
            {
                k++;
                if(!a[i][j].equals(old[i][j]))
                {            
                c[0]=i;c[1]=j;    
                cell++;
                }
            }    
            old[i][j]=a[i][j];
            if(k==225)
            {
                int index=0,max=p2[0];
                for(int i = 1; i < n;i++)
                {
                    if(p2[i] > max)
                    {
                        if(p2[i]==max)
                        {
                            index=7;
                        }
                        max = p2[i];
                        index=i;
                    }
                }
                if(index==7)
                {
                    l7.setText("Its A Tie Game");
                    f2.add(l7);
                    l7.setVisible(true);
                }
                else
                {
                if(index==0)
                {
                    l7.setText("Player A Won The Game");
                    f2.add(l7);
                    l7.setVisible(true);
                }
                else if(index==1)
                {
                    l7.setText("Player B Won The Game");
                    f2.add(l7);
                    l7.setVisible(true);
                }
                else if(index==2)
                {
                    l7.setText("Player C Won The Game");
                    f2.add(l7);
                    l7.setVisible(true);
                }
                else if(index==3)
                {
                    l7.setText("Player D Won The Game");
                    f2.add(l7);
                    l7.setVisible(true);
                }
                else if(index==4)
                {
                    l7.setText("Player E Won The Game");
                    f2.add(l7);
                    l7.setVisible(true);
                }
                else if(index==5)
                {
                    l7.setText("Player F Won The Game");
                    f2.add(l7);
                    l7.setVisible(true);
                }
                
                }
            }
        }
    }
    if(cell>1)
    {
        i=c[0];j=c[1];
        g--;
        a[i][j]="";
        old[i][j]="";
        l7.setText("Entering Multiples Is Not Allowed");
        f2.add(l7);
        l7.setVisible(true);
    }
    return c;
}

public void check(int row,int col)
{
    points=0;
    checkdiagonaldownright(row,col);
    checkdiagonalupleft(row,col);
    checkdiagonalupright(row,col);
    checkdiagonalleftdown(row,col);
    checkdown(row,col);
    checkup(row,col);
    checkleft(row,col);
    checkright(row,col);
    turnpoints();
    //for(String i : storage) {
        //System.out.println(i);
    //}
}

public void checkdiagonaldownright(int row ,int col)
{
    s="";
    j=col;
            for(i=row;(i<15)&&(j<15)&&(!a[i][j].isEmpty());i++,j++)
            {
                s=s+a[i][j];
                Subcheck_Score(s);
            }
}

public void checkdiagonalupleft(int row ,int col)
{
    s="";
    i=row;
    j=col;
            while((i>=0)&&(j>=0))
            {
                if(!a[i][j].isEmpty())
                {
                s=s+a[i][j];
                Subcheck_Score(s);
                }
                i--;
                j--;
            }
}

public void checkdiagonalupright(int row ,int col)
{
    s="";
    i=row;
    j=col;
    while((i>=0)&&(j<15))
    {
            if(!a[i][j].isEmpty()) 
            {
                s=s+a[i][j];
                Subcheck_Score(s);
            }
            i--;
            j++;
    }
}

public void checkdiagonalleftdown(int row ,int col)
{
    s="";
    i=row;
    j=col;
    while((i<15)&&(j>=0))
    {
            if(!a[i][j].isEmpty()) 
            {
                s=s+a[i][j];
                Subcheck_Score(s);
            }
            i++;
            j--;
    }
}

public void checkdown(int row ,int col)
{
    s="";
    j=col;
            for(i=row;i<54&&!a[i][j].isEmpty();i++)
            {
                s=s+a[i][j];
                Subcheck_Score(s);
            }
}

public void checkup(int row ,int col)
{
    s="";
    j=col;
            for(i=row;i>=0&&!a[i][j].isEmpty();i--)
            {
                s=s+a[i][j];
                Subcheck_Score(s);
            }
}
            
public void checkleft(int row ,int col)
{
    s="";
    i=row;
    j=col;
    while(j>=0)
    {
            if(!a[i][j].isEmpty()) 
            {
                s=s+a[i][j];
                Subcheck_Score(s);
            }
            j--;
    }
}

public void checkright(int row ,int col)
{
    s="";
    i=row;
    j=col;
    while(j<14)
    {
            if(!a[i][j].isEmpty()) 
            {
                s=s+a[i][j];
                Subcheck_Score(s);
            }
            j++;
    }
}

public void Subcheck_Score(String s)
{
    if(!(storage.contains(s)))
    {
    if(search(s)) 
    {
        storage.add(s);
        thelp.setText("Words Formed:");
        for (String a : storage ) {
            thelp.append("\n"+a.toUpperCase());
        }
        f2.add(scroll);
        if(s.length()>points)
        points=s.length();
    }
    }
    s=new StringBuffer(s).reverse().toString();
    if(!(storage.contains(s)))
    {
    if(search(s)) 
    {
        storage.add(s);
        thelp.setText("Words Formed:");
        for (String a : storage ) {
            thelp.append("\n"+a.toUpperCase());
        }
        f2.add(scroll);
        if(s.length()>points)
        points=s.length();
    }
  }
}

